import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import axios from 'axios';
import L from 'leaflet';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import 'leaflet/dist/leaflet.css';

function Dashboard() {
  const [parkingSpots, setParkingSpots] = useState([]);
  const [loadingSpotId, setLoadingSpotId] = useState(null);
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredSpots, setFilteredSpots] = useState([]);
  const [cityCoordinates, setCityCoordinates] = useState([28.6448, 77.216721]); // Default: New Delhi

  useEffect(() => {
    fetchSpots();
  }, []);

  const fetchSpots = async () => {
    try {
      const res = await axios.get('http://localhost:5000/api/spots');
      setParkingSpots(res.data);
      setFilteredSpots(res.data);
    } catch (err) {
      console.error('Error fetching parking spots:', err);
    }
  };

  const handleBooking = async (spotId) => {
    const confirmBooking = window.confirm('Do you want to book this spot?');
    if (!confirmBooking) return;

    try {
      const token = localStorage.getItem('token');
      if (!token) {
        toast.error('Please log in to book a spot.');
        return;
      }

      setLoadingSpotId(spotId);

      await axios.post(
        'http://localhost:5000/api/bookings',
        { spotId },
        {
          headers: {
            Authorization: `Bearer ${token}`,
          },
        }
      );

      toast.success('Booking successful!');
      fetchSpots(); // Refresh spots
    } catch (err) {
      console.error('Error booking spot:', err);
      toast.error('Booking failed. Try again.');
    } finally {
      setLoadingSpotId(null);
    }
  };

  const customMarkerIcon = (availableSlots) => {
    return new L.Icon({
      iconUrl: availableSlots > 0
        ? 'https://cdn-icons-png.flaticon.com/512/684/684908.png' // Green icon
        : 'https://cdn-icons-png.flaticon.com/512/684/684908-gray.png', // Gray icon
      iconSize: [35, 35],
    });
  };

  const handleSearch = (e) => {
    setSearchQuery(e.target.value);

    if (e.target.value === '') {
      setFilteredSpots(parkingSpots);
    } else {
      const filtered = parkingSpots.filter((spot) =>
        spot.city.toLowerCase().includes(e.target.value.toLowerCase())
      );
      setFilteredSpots(filtered);
    }
  };

  const searchCity = async (city) => {
    if (!city) return;

    try {
      const response = await axios.get(`https://nominatim.openstreetmap.org/search`, {
        params: {
          q: city,
          format: 'json',
          addressdetails: 1,
        },
      });

      if (response.data && response.data[0]) {
        const { lat, lon } = response.data[0];
        setCityCoordinates([lat, lon]); // Update the map center
        setFilteredSpots(parkingSpots.filter(spot => spot.city.toLowerCase().includes(city.toLowerCase())));
      }
    } catch (err) {
      console.error('Error fetching city data:', err);
    }
  };

  return (
    <div style={{ display: 'flex', height: '90vh' }}>
      <ToastContainer />

      {/* Sidebar */}
      <div style={{
        width: '300px',
        backgroundColor: '#f7f7f7',
        overflowY: 'scroll',
        padding: '20px',
        borderRight: '2px solid #ddd'
      }}>
        <h2 style={{ textAlign: 'center' }}>Parking Spots</h2>

        {/* Search Bar */}
        <input
          type="text"
          value={searchQuery}
          onChange={handleSearch}
          onBlur={() => searchCity(searchQuery)} // Trigger city search when focus is lost
          placeholder="Search by city..."
          style={{
            padding: '8px',
            width: '100%',
            marginBottom: '20px',
            borderRadius: '5px',
            border: '1px solid #ccc'
          }}
        />

        {filteredSpots.length === 0 && <p>No spots found.</p>}

        {filteredSpots.map((spot) => (
          <div key={spot._id} style={{
            marginBottom: '20px',
            padding: '10px',
            border: '1px solid #ccc',
            borderRadius: '8px',
            backgroundColor: '#fff',
          }}>
            <h3 style={{ margin: '0 0 10px' }}>{spot.name}</h3>
            <p style={{ margin: '0 0 5px' }}><strong>City:</strong> {spot.city}</p>
            <p style={{ margin: '0 0 10px' }}>
              <strong>Slots:</strong> {spot.availableSlots}/{spot.totalSlots}
            </p>

            {spot.availableSlots > 0 ? (
              <button
                onClick={() => handleBooking(spot._id)}
                disabled={loadingSpotId === spot._id}
                style={{
                  backgroundColor: '#4CAF50',
                  color: 'white',
                  padding: '8px 12px',
                  border: 'none',
                  borderRadius: '5px',
                  cursor: 'pointer',
                  width: '100%',
                }}
              >
                {loadingSpotId === spot._id ? 'Booking...' : 'Book Now'}
              </button>
            ) : (
              <button
                disabled
                style={{
                  backgroundColor: 'gray',
                  color: 'white',
                  padding: '8px 12px',
                  border: 'none',
                  borderRadius: '5px',
                  width: '100%',
                }}
              >
                No Slots
              </button>
            )}
          </div>
        ))}
      </div>

      {/* Map */}
      <div style={{ flex: 1 }}>
        <MapContainer
          center={cityCoordinates}
          zoom={13}
          style={{ height: '100%', width: '100%' }}
        >
          <TileLayer
            attribution='&copy; OpenStreetMap contributors'
            url='https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'
          />
          {filteredSpots.map((spot) => (
            <Marker
              key={spot._id}
              position={[spot.latitude, spot.longitude]}
              icon={customMarkerIcon(spot.availableSlots)}
            >
              <Popup>
                <div style={{ textAlign: 'center' }}>
                  <h3 style={{ margin: '5px 0' }}>{spot.name}</h3>
                  <p style={{ margin: '5px 0' }}>{spot.city}</p>
                  <p style={{ margin: '5px 0' }}>
                    <strong>Slots:</strong> {spot.availableSlots}/{spot.totalSlots}
                  </p>

                  {spot.availableSlots > 0 ? (
                    <button
                      onClick={() => handleBooking(spot._id)}
                      disabled={loadingSpotId === spot._id}
                      style={{
                        backgroundColor: '#4CAF50',
                        color: 'white',
                        padding: '8px 12px',
                        border: 'none',
                        borderRadius: '5px',
                        cursor: 'pointer',
                        marginTop: '5px',
                      }}
                    >
                      {loadingSpotId === spot._id ? 'Booking...' : 'Book Now'}
                    </button>
                  ) : (
                    <button
                      disabled
                      style={{
                        backgroundColor: 'gray',
                        color: 'white',
                        padding: '8px 12px',
                        border: 'none',
                        borderRadius: '5px',
                        marginTop: '5px',
                      }}
                    >
                      No Slots Available
                    </button>
                  )}
                </div>
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </div>
    </div>
  );
}

export default Dashboard;
